import React, { useState, useEffect } from 'react';
import axios from 'axios';
import '../assets/styles.css';

function Portfolio({ setModalState }) {
  const [projects, setProjects] = useState([]);
  const [loading, setLoading] = useState(true);
  const [activeModal, setActiveModal] = useState(null);

  useEffect(() => {
    axios.get('https://api.github.com/users/AlexanderG-CA/repos')
      .then(response => {
        setProjects(response.data);
        setLoading(false);
      })
      .catch(error => console.error('Error fetching GitHub projects', error));
  }, []);

  const lockCursor = () => {
    document.body.style.overflow = 'hidden'; // Hindrar scroll
    document.addEventListener("mousemove", restrictMouse, true);
    document.addEventListener("keydown", preventEscape, true);
  };

  const unlockCursor = () => {
    document.body.style.overflow = 'auto';
    document.removeEventListener("mousemove", restrictMouse, true);
    document.removeEventListener("keydown", preventEscape, true);
  };

  const restrictMouse = (event) => {
    const modal = document.querySelector('.modal-content');
    if (!modal) return;

    const rect = modal.getBoundingClientRect();
    const x = Math.max(rect.left, Math.min(event.clientX, rect.right));
    const y = Math.max(rect.top, Math.min(event.clientY, rect.bottom));
    
    event.preventDefault();
    event.stopPropagation();
    window.moveTo(x, y); // Försöker flytta musen tillbaka inom gränserna
  };

  const preventEscape = (event) => {
    if (event.key === 'Escape') {
      event.preventDefault();
      alert("Du kan inte stänga modalen med ESC! Använd stängningsknappen.");
    }
  };

  const openModal = (event, projectId) => {
    event.preventDefault();
    event.stopPropagation();
    setActiveModal(projectId);
    setModalState(true);
    lockCursor();
  };

  const closeModal = () => {
    setActiveModal(null);
    setModalState(false);
    unlockCursor();
  };

  return (
    <div className="portfolio-page">
      <header>
        <h1>Portfolio</h1>
      </header>

      <main>
        <section className="portfolio">
          {loading ? (
            <p>Laddar projekt...</p>
          ) : (
            projects.map((project) => (
              <div key={project.id} className="project">
                <a 
                  href={project.html_url} 
                  target="_blank" 
                  rel="noopener noreferrer" 
                  className="project-link"
                >
                  <img src={project.owner.avatar_url} alt={project.name} />
                  <h3>{project.name}</h3>
                </a>
                <button className="info-button" onClick={(event) => openModal(event, project.id)}>Mer info</button>

                {activeModal === project.id && (
                  <div className="modal-overlay">
                    <div className="modal-content">
                      <span className="close" onClick={closeModal}>&times;</span>
                      <h2>{project.name}</h2>
                      <p><strong>Beskrivning:</strong> {project.description || 'Det här är den första iterationen av denna hemsidan innan dynamiska aspekter tillförts.'}</p>
                      <p><strong>Skapat:</strong> {project.created_at ? project.created_at.split('T')[0] : 'Okänt'}</p>
                      <p><strong>Senast uppdaterad:</strong> {project.updated_at ? project.updated_at.split('T')[0] : 'Okänt'}</p>
                      <p><strong>Stjärnor:</strong> ⭐ {project.stargazers_count || 0}</p>
                      <p><strong>Språk:</strong> {project.language || 'Ej angivet'}</p>
                      <a href={project.html_url} target="_blank" rel="noopener noreferrer" className="github-link">
                        Besök GitHub-repo
                      </a>
                    </div>
                  </div>
                )}
              </div>
            ))
          )}
        </section>
      </main>

      <footer>
        <p>&copy; 2025 Mitt CV</p>
      </footer>
    </div>
  );
}

export default Portfolio;
